export default {
  title: 'DNS settings schema',
  type: 'object',
  properties: {
    staticEntries: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          name: { type: 'string' },
          description: { type: 'string' },
          address: { type: 'string' },
        },
        required: ['name', 'description', 'address'],
        additionalProperties: false,
      },
    },
    localServers: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          domain: { type: 'string' },
          localServer: { type: 'string' },
        },
        required: ['domain', 'localServer'],
        additionalProperties: false,
      },
    },
  },
  required: ['staticEntries', 'localServers'],
  additionalProperties: false,
}
